import { createApp } from 'vue';
import App from './App.vue';
import router from './router';
import store from './store';
import axios from 'axios';
import interceptor from './interceptor';

axios.defaults.withCredentials = true
interceptor()

createApp(App)
  .use(router)
  .use(store)
  .mount('#app')
